import React, { useState } from "react";
import { Grid, Container } from "@material-ui/core";
import OurWork from "./OurWork";
import Button from "../Button";
import styled from "styled-components";

function OurWorks() {
    const [featured] = useState([
        {
            title: "KEMIS YELEBESKU LET",
            image: "assets/kemis-yelebesku.png",
            type: "Feature Film",
        },
        {
            title: "TEDDY AFRO - MAR ESKE TUAF",
            image: "assets/teddy-afro.png",
            type: "Music Video",
        },
        {
            title: "EWUR AMORA KELABI",
            image: "assets/ewuramora.png",
            type: "Documentary",
        },
        {
            title: "JAON BEER",
            image: "assets/jano.png",
            type: "Advertising",
        },
        {
            title: "KEMIS YELEBESKU LET",
            image: "assets/kemis-yelebesku.png",
            type: "Feature Film",
        },
        {
            title: "TEDDY AFRO - MAR ESKE TUAF",
            image: "assets/teddy-afro.png",
            type: "Music Video",
        },
        {
            title: "EWUR AMORA KELABI",
            image: "assets/ewuramora.png",
            type: "Documentary",
        },
        {
            title: "JAON BEER",
            image: "assets/jano.png",
            type: "Advertising",
        },
    ]);

    return (
        <Container>
            <Grid container direction="row" spacing={3}>

                {featured.map((f, key) => (
                    <GridCenter item  key={key} xs={12} sm={12} md={6} >
                        <OurWork {...f} />
                    </GridCenter>
                ))}

            </Grid>
            <Button>View More</Button>
        </Container>
    );
}

const GridCenter = styled(Grid)`
 text-align:center;
`;



export default OurWorks;
